import React from 'react';

const CarouselItem = ({bgUrl}) => {
    return (
      <div
        className="carousel-item"
        style={{
            backgroundImage: `url(${bgUrl})`,
            objectFit: "contain"
        }}
      ></div>
    );
}

export default CarouselItem;
